import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
          <hr/>
      </header>

      <body className="App-body">
        <hr className="Slectiongrenze"/>

        <div className="vl">  <column>
            <p>Icicle</p>
            <p>Icicle1</p>
            <p>Icicle2</p>
      </column></div>
      <column>
            <p>Zoomable</p>
            <p>Zoomable</p>
            <p>Zoomable</p>
      </column>
        <div id="mySidenav" className="sidenav">
            <a href="javascript:void(0)" className="closebtn" onClick="closeNav()">&times;</a>
            <a href="#">About</a>
            <a href="#">Services</a>
            <a href="#">Clients</a>
            <a href="#">Contact</a>
        </div>

        <div id="main">
            <h2>Sidenav Push Example</h2>
            <p>Click on the element below to open the side navigation menu, and push this content to the right. Notice
                that we add a black see-through background-color to body when the sidenav is opened.</p>
            <span style="font-size:30px;cursor:pointer" onClick="openNav()">&#9776; open</span>
        </div>


            function openNav() {
            document.getElementById("mySidenav").style.width = "250px"}
            document.getElementById("main").style.marginLeft = "250px";
            document.body.style.backgroundColor = "rgba(0,0,0,0.4)";
            }

            function closeNav() {
            document.getElementById("mySidenav").style.width = "0"}
            document.getElementById("main").style.marginLeft= "0";
            document.body.style.backgroundColor = "white";
        }
      <icicle/>
      </body>

    </div>
  );
}

export default App;
